import React from "react";
import Faworite from "../Components/Ffaworit";
import NaviBar from "../Components/Nnavibar";

const Favorite = ()=>{
    let data=[]
    for(let i=0;i<localStorage.length;i++){
        data.push(JSON.parse(localStorage.getItem(localStorage.key(i))));
        console.log(data[i]);
    }
  const items = data.map((i) =>
    <Faworite key={i.idMeal} item={i} />);
        return (
            <>
            <NaviBar button={true}/>
            <div>
                {items.length>0?items:<p style={{textAlign:"center", top:"50px"}}>You`re not have a faworite vishes</p>}
                </div>
            </>
        )
    }

export {Favorite}
